function TodoItem({ todo, onToggle, onDelete }) {
  return (
    <div className={`todo ${todo.completed ? "completed" : ""}`}>
      <span onClick={() => onToggle(todo._id)}>{todo.text}</span>
      <button onClick={() => onDelete(todo._id)}>‚ùå</button>
    </div>
  );
}

export default TodoItem;
